¡BIENVENIDOS A DONBE ISLAND!

&nbsp;

El pasado lunes, el alumnado del tercer ciclo se adentró en una nueva aventura, donde tendrán que reconstruir de cero a lo largo del curso la isla llamada “Donbe Island” devastada por el huracán “Veranocorto”. Tom Nook, junto con sus ayudantes, construirán una isla donde reine la sostenibilidad, la igualdad y el bienestar.
